import React, { useEffect, useState } from "react";

export default function UserList() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetch("/api/users", {
      headers: { Authorization: "Basic " + btoa("admin:adminpwd") }
    })
      .then(res => res.json())
      .then(setUsers)
      .catch(() => setUsers([]));
  }, []);

  return (
    <div>
      <h2>User List</h2>
      <ul>
        {users.map(u => (
          <li key={u.id}>
            {u.username} ({u.role}) - {u.email}
          </li>
        ))}
      </ul>
    </div>
  );
}
